import React, { useState } from "react";
import { useEffect } from "react";
import "./css/ContractText.css";
import leftLogo from "./assets/left_logo.png";
import rightLogo from "./assets/right_logo.png";
import centerLogo from "./assets/center_logo.png";

const ContractText = ({ handleOpenComponent, handleCloseComponent }) => {
    useEffect(() => {
        handleOpenComponent('contract_projects', true); // or 'ContractText', true
      
        return () => {
            handleCloseComponent('contract_projects');
        };
      }, [handleOpenComponent, handleCloseComponent]);

    return (
    <div className="contract_projects-container">
      <div className="contract_projects-toolbar">
        <button onClick={() => handleCloseComponent('contract_projects')}><b>B</b></button>
        <button onClick={() => handleCloseComponent('contract_projects')}><i>I</i></button>
        <button onClick={() => handleCloseComponent('contract_projects')}><u>U</u></button>
        <button onClick={() => handleCloseComponent('contract_projects')} className="justify-icon"><img src={leftLogo} alt="left justify icon" /></button>
        <button onClick={() => handleCloseComponent('contract_projects')} className="justify-icon"><img src={centerLogo} alt="center justify icon" /></button>
        <button onClick={() => handleCloseComponent('contract_projects')} className="justify-icon"><img src={rightLogo} alt="right justify icon" /></button>
      </div>
      <div className="contract_projects-body">
        <h1>LOL</h1>
        </div>

    </div>
  );
};

export default ContractText;
